import styled from "styled-components";

const InputComponent = styled.input`
  ${(props) =>
    props.type === "text" ||
    props.type === "password" ||
    props.type === "email"}
  background-color: var(--transparent);
`;

const Input = ({ type, value }) => {
  return <InputComponent type={type}></InputComponent>;
};

export default Input;
